import React from 'react';

function Navigation() {



  return (
    <nav className="navbar navbar-default navbar-fixed-top bg-dark navbar-dark">
        <a className="navbar-brand" href="/">KeepItSafe</a>
        <a className="nav-item nav-link" href="/add-new">Add New</a>
        <a className="nav-link" href="/view-all">View All</a>
        <a className="nav-link" href="/">Log Out</a>
    </nav>
  )
}

export default Navigation;
